import React,{Component} from "react";
import Signin from './signIn'
import Signup from './signUp' 
import './signInUpContainer.css'

class SignInOutContainer extends Component{
    constructor(props){
        super(props);
        this.state={
            page:"signIn"
        }


        this.changePageToSignUp = this.changePageToSignUp.bind(this);
    }
    changePageToSignUp=()=>{
      
            this.setState(this.state.page="signUp")

    }
    render(){
        return(
            <React.Fragment>
                <div class="tab">
                 <button  onClick={this.changePageToSignUp}>Sign In</button>
                 <button  onClick={this.changePageToSignIn}>Sign UP</button>
                </div>
                {this.state.page=="signIn"?<Signin/>:<Signup/>}
            </React.Fragment>

        )}
};

export default SignInOutContainer;
